import axios from "axios";

const key = "6810abd8f884838c4dc38f7fe9517eda";
const token =
  "7b34f13282a1942371bb3bea609420750b0d9b859ea8a8523a5ea28db42f2f79";
const API_URL_TRELLO =
  "https://api.trello.com/1/cards?key=" + key + "&token=" + token;
let ApiTrello = axios.create({
  baseURL: API_URL_TRELLO,
  headers: {
    Accept: "application/json",
    "Content-Type": "application/json;charset=UTF-8",
  },
});

export default ApiTrello;
